import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { useEffect } from 'react';
import Header from './components/Header';
import IrisPredictForm from './components/IrisPredictForm';
import ResultPredictForm from './components/Cifar10PredictForm';
import Home from './components/Home';
import Register from './pages/Register';
import Login from './pages/Login';
import { UserProvider, useUser } from './contexts/UserContext';

const App = () => {
  const { isLoggedIn, setIsLoggedIn, user } = useUser();

  useEffect(() => {
    const storedUser = JSON.parse(localStorage.getItem('user'));
    if (storedUser) {
      setIsLoggedIn(true);
      setUser(storedUser);
    }
  }, [setIsLoggedIn, setUser]);

  return (
    <UserProvider>
      <Router>
        {isLoggedIn && (
          <Header setIsLoggedIn={setIsLoggedIn} />
        )}

        <Routes>
          <Route path="/" element={isLoggedIn ? <Home setIsLoggedIn={setIsLoggedIn} /> : <Navigate to="/login" />} />
          <Route path="/iris-model" element={<IrisPredictForm modelType="iris_model" />} />
          <Route path="/result-model" element={<ResultPredictForm modelType="result_model" />} />
          <Route
            path="/register"
            element={isLoggedIn ? <Navigate to="/" /> : <Register />}
          />
          <Route
            path="/login"
            element={isLoggedIn ? <Navigate to="/" /> : <Login />}
          />
        </Routes>
      </Router>
    </UserProvider>
  );
};

export default App;
